import './App.css';
import HomePage from './Components/HomePage.js';
import Header from './Components/Header';
import Registrar from "./Components/Registrar";
import Login from './Login.js'
import React, {useEffect, useState} from "react";
import {Switch, Route} from "react-router-dom";
import useUser from "./Servicio/autenticationservice";
import {UserContextProvider} from "./Context/UserContextProvider";
import AuthenticatedRoute from "./Servicio/PrivateRoute";

export default function App () {
    const {isLogged, logout, foundname, user} = useUser();


  return (
      <UserContextProvider>
          <div>
              <Header/>
              <Switch>
                  <Route component={Login} path="/"/>

                  <AuthenticatedRoute path="/Homepage" component={HomePage} appProps={{ isLogged }}/>
                  <AuthenticatedRoute component={Registrar} path="/Registre" appProps={{ isLogged }}/>
              </Switch>
          </div>

      </UserContextProvider>

  );
}
